  [],\n\t\"num_tags\": 0,\n\t\"name\": \"oceanographic-profile-data-collected-from-ctd-and-sound-velocimeter-moving-vessel-profiler-case597f\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130784 includes physical
  and profile data collected aboard NOAA Ship THOMAS JEFFERSON during project S-A936-TJ-09
  in the North Atlantic Ocean on 2009-10-01. These data include SOUND VELOCITY. The
  instruments used to collect these data include CTD and sound velocimeter - moving
